import { useState} from 'react';
import data from './../../assets/products.json';
import ItemList from '.././ItemList/ItemList';

const ItemListContainer = ( {greeting}) => {
    
    return (
        <div>
            <h1>{greeting}</h1>
            <ItemList products = { data }/>
        </div>
    );
}
export default ItemListContainer;
